import React from 'react'
import { Link } from 'react-router-dom';
import "./Header.css"
const Header = () => {
  return (
    <div className='nav'>
        <div className='navleft'>
            <Link to="/"><img className='logo_img' alt="" src="https://upload.wikimedia.org/wikipedia/commons/thumb/6/69/IMDB_Logo_2016.svg/2560px-IMDB_Logo_2016.svg.png"></img></Link>
            <Link to="/movie/popular" style={{textDecoration:"none"}}><span>Popular</span></Link>
            <Link to="/movie/top_rated" style={{textDecoration:"none"}}><span>Top Rated</span></Link>
            <Link to="/movie/upcoming" style={{textDecoration:"none"}}><span>Upcoming</span></Link>
        </div>
        <div className='navRight'>
          <input className='searchBar'></input>
          <button className='sera'>Search</button>
        </div>
    </div>
  )
}

export default Header;
